import {Card, CardContent, Typography, Button, CardActions, Rating} from '@mui/material';
import {useNavigate} from 'react-router-dom';
import { SERVICEINFO_ROUTE } from '../../utils/constants';

const ServiceItem = ({service}) => {
  const navigate = useNavigate();
  return (
    <Card sx={{ minWidth: 700 }} className='service-card'>
      <CardContent>
        <Typography sx={{ fontSize: 20 }} color="text.secondary" gutterBottom>
          Service
        </Typography>
        <Typography variant="h5" component="div">
          {service.title}
        </Typography>
        <Typography variant="body2">
          {service.price} руб.
        </Typography>
        <Rating className='rating' readOnly value={service.rating}></Rating>
      </CardContent>
      <CardActions>
        <Button size="large" s onClick={() => navigate(SERVICEINFO_ROUTE + '/' + service.id)}>Learn More</Button>
      </CardActions>
    </Card>
  );
}

export default ServiceItem;
